import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../Register/Register.css";
import axios from "axios";
import { GoogleLogin } from "@react-oauth/google";
import { useDispatch } from "react-redux";
import { loginSuccess, setUser } from "../redux/authSlice";
import { useQueryClient } from "@tanstack/react-query";

const Login = () => {
  const [values, setValues] = useState({
    email: "",
    password: "",
  });

  const [alert, setAlert] = useState("");
  const [alertType, setAlertType] = useState("");

  const dispatch = useDispatch();
  const navigate = useNavigate();
  const queryClient = useQueryClient();

  const handleChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };

  const showAlert = (msg, type) => {
    setAlert(msg);
    setAlertType(type);
    setTimeout(() => {
      setAlert("");
      setAlertType("");
    }, 1000);
  };

  /* ---------------- NORMAL LOGIN ---------------- */
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        "http://localhost:3001/api/login",
        values,
        {
          withCredentials: true, // ðŸ”¥ REQUIRED FOR COOKIES
        }
      );

      showAlert(response.data.message, "success");

      dispatch(setUser());

      // ðŸ”„ re-check enroll status & user data
      queryClient.invalidateQueries(["enroll-status"]);
      queryClient.invalidateQueries(["me"]);

      setTimeout(() => {
        navigate("/");
      }, 500);
    } catch (error) {
      showAlert(
        error.response?.data?.message || "Login failed",
        "error"
      );
    }
  };

  /* ---------------- GOOGLE LOGIN ---------------- */
  const handleGoogleLogin = async (credentialResponse) => {
    try {
      await axios.post(
        "http://localhost:3001/api/google-login",
        {
          credential: credentialResponse.credential,
        },
        {
          withCredentials: true, // ðŸ”¥ REQUIRED
        }
      );

      showAlert("Google login successful", "success");

      dispatch(setUser());

      queryClient.invalidateQueries(["enroll-status"]);
      queryClient.invalidateQueries(["me"]);

      setTimeout(() => {
        navigate("/");
      }, 500);
    } catch {
      showAlert("Google login failed", "error");
    }
  };

  return (
    <div className="body">
      <div className="Register">
        <Link to="/" className="backBtn">Back</Link>

        <h1>Login</h1>

        {alert && <div className={`alert ${alertType}`}>{alert}</div>}

        <form onSubmit={handleSubmit}>
          <div>
            <label>Email</label>
            <input
              type="email"
              name="email"
              placeholder="Enter Email"
              onChange={handleChange}
              required
            />
          </div>

          <div>
            <label>Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter Password"
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit">Login</button>
        </form>

        <div style={{ margin: "15px 0", textAlign: "center" }}>OR</div>

        <div style={{ display: "flex", justifyContent: "center" }}>
          <GoogleLogin
            onSuccess={handleGoogleLogin}
            onError={() => showAlert("Google Login Failed", "error")}
          />
        </div>

        <div style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}>
          <p>Don't have an account?</p>
          <Link to="/Register" style={{ marginLeft: "5px" }}>Register</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
